import { useState } from 'react';
import { useHistory } from 'react-router-dom';

function HeadNav() {


    const history = useHistory();
    var [AdminDtl, setAdminDtl] = useState({ FirstName: "Ritesh", LastName: "Padalwar" })

    const Logout =()=>{
        history.push('/Logout');
    }
    const GiveFeedback=()=>{
        history.push("/GiveFeedback");
    }
    const Profile=()=>{
        history.push("/Profile");
    }
    const Home=()=>{
        history.push("/LoggedIn");
    }
    return <>


        <nav className="navbar " style={{ backgroundColor: "aqua" }}>
            <div className="container-fluid">
                <div className="navbar-header">
                    <a className="navbar-brand" href="#">Project KYC</a>
                </div>
                <ul className="nav navbar-nav">
                    <li className="active"><button className="btn btn-danger navbar-btn" onClick={Home}>Home</button></li>

                    <li><button className="btn btn-danger navbar-btn" style={{marginLeft:'1.5%'}} onClick={GiveFeedback}>Feedback</button></li>
                    <li><button className="btn btn-danger navbar-btn" style={{marginLeft:'4%'}} onClick={Profile}>Profile</button></li>
                    <li><button className="btn btn-danger navbar-btn" style={{marginLeft:'4%'}} onClick={Profile}>Profile</button></li>
                    <li><button className="btn btn-danger navbar-btn" style={{marginLeft:'%'}} onClick={Profile}>Profile</button></li>
                </ul>
                <div className="text-right">
                    {AdminDtl.FirstName} { } {AdminDtl.LastName} { }

                    <button onClick={Logout} className="btn btn-danger navbar-btn">Logout</button>

                </div>
            </div>
        </nav>



    </>
}

export default HeadNav;
